response.about:
Я такая беспредельная, просто потому, что нет предела СОВЕРШЕНСТВУ...(а)

для кого-то, я есть всегда;
для кого-то, я есть иногда;
кому-то я очень нужна, но меня нет никогда;
иногда я сдаюсь и даюсь;
но это не значит совсем;
я могу убежать, что меня не догнать;
иногда так уснуть, что не будет 5 дней;
но меня не забыть; а хотя...
иногда, о себе забываю сама. (а)
